import {EstudanteStyled} from './EstudanteStyled'

function Estudante(props) {
  return (
    <div>
      <Es>
        <li>nome: {props.nome}</li>
        <li>idade: {props.idade}</li>
        <li>corDaRoupa:{props.corDaRoupa}</li>
        <li>criadoPor:{props.criadoPor}</li>
      </Es>
    </div>
  );
}

export default Estudante;
